package com.cw;

import android.graphics.Bitmap;
import android.graphics.BitmapFactory;
import android.util.Base64;

public class ImgRes {

	

	private static final String s_logo = "";
	private static final String s_close = "";
	
	
	public static Bitmap bmLogo;
	public static Bitmap bmClose;
	
	static 
	{
		byte[] decode;
		 decode = Base64.decode(s_logo, Base64.NO_WRAP);
		bmLogo = BitmapFactory.decodeByteArray(decode, 0, decode.length);
		
		decode = Base64.decode(s_close, Base64.NO_WRAP);
		bmClose = BitmapFactory.decodeByteArray(decode, 0, decode.length);
	}
	
	
}
